/*Table structure for table `categories` */

DROP TABLE IF EXISTS `categories`;

CREATE TABLE `categories` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `description` varchar(200) NOT NULL,
  `type` enum('selection','wselection') NOT NULL,
  `mode` enum('personal','group') NOT NULL DEFAULT 'personal',
  `status` enum('inactive','active','final','deleted') NOT NULL DEFAULT 'inactive',
  `actual_stage` enum('assistance','selection','classify_1','classify_2') DEFAULT NULL,
  `num_begin` int(11) NOT NULL DEFAULT '1',
  `order` smallint(5) unsigned DEFAULT NULL,
  `count_competitors` tinyint(4) NOT NULL DEFAULT '0',
  `count_presents` tinyint(4) NOT NULL DEFAULT '0',
  `tournament_id` int(10) unsigned NOT NULL,
  PRIMARY KEY (`id`,`type`),
  KEY `fk_categories_tournaments1_idx` (`tournament_id`),
  CONSTRAINT `fk_categories_tournaments1` FOREIGN KEY (`tournament_id`) REFERENCES `tournaments` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=182 DEFAULT CHARSET=utf8;

