  `mom_prefix` varchar(20) DEFAULT NULL,
  `mom_name` varchar(45) DEFAULT NULL,
  `breeder` varchar(100) DEFAULT NULL,
  `OWNER` varchar(100) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

